        super(props);
        this.state = {   
        };
    }
 
    render() {
        return (
			<div style={{ width: '80%',lineHeight: '1em'}}>
				<Progress strokeColor={{from: '#0066FF',to: '#87d068',}} percent={18} strokeLinecap="round" strokeWidth='2%' size="small" />
				<Progress strokeColor={{from: '#108ee9',to: '#87d068',}} percent={90} size="small" />
				<Progress strokeColor={{from: '#108ee9',to: '#87d068',}} percent={30} size="small" />
				<Progress strokeColor={{from: '#108ee9',to: '#87d068',}} percent={50} size="small" />
				<Progress strokeColor={{from: '#108ee9',to: '#87d068',}} percent={66} size="small" />
				<Progress strokeColor={{from: '#108ee9',to: '#87d068',}} percent={12} size="small" />
			</div>
        )
    }
}
